  manageClientList() {
    console.log('this.clientLIst : ', this.clientLIst);
    let clientList = [], originalClientLIst = [], subClientList = [];
    this.clientLIst.Data.Client_Name_Lookup.forEach(clientObj => {
      clientList.push({
        Client_Name: clientObj.Client_Name,
        Client_Name_ID: clientObj.Client_Name_ID
        // clientObj
      });

      originalClientLIst.push({
        Client_Name: clientObj.Client_Name,
        Client_Name_ID: clientObj.Client_Name_ID,
        Original_Client_Name_ID: clientObj.Original_Client_Name_ID
        // clientObj
      });

      subClientList.push({
        SubClient_Name: clientObj.SubClient_Name,
        SubClient_Name_Id: clientObj.SubClient_Name_Id
        // clientObj
      });
    });
    clientList = _.uniqBy(clientList, 'Client_Name_ID');
    originalClientLIst = _.uniqBy(originalClientLIst, 'Original_Client_Name_ID');
    subClientList = _.uniqBy(subClientList, 'SubClient_Name_Id');
    // console.log(' clientList , originalClientLIst , subClientList : ', clientList, originalClientLIst, subClientList)
    return {
      clientList: clientList,
      originalClientLIst: originalClientLIst,
      subClientList: subClientList,
    }
  }
